import { borderRadius, fontSize } from "@mui/system";
import React from "react";
import "./certificate-card-style.css"

import cert_aws from "../img/certificate/aws.jpg";
import Position from "rsuite/esm/internals/Overlay/Position";


function CertificateCard(props){
  const image = cert_aws;
  const title = "AWS for Beginner"

  return (
    <div id="card">
        <img src={cert_aws} id="image"/>
        <span id="title"><b>{title}</b></span>
    </div>
  )
}

export default CertificateCard;
